import "./TaskCard.css";
import "../../App.css";
import "../OutlinedButton/OutlinedButton";
import OutlinedButton from "../OutlinedButton/OutlinedButton";
const TaskCard = () => {
    return (
        <div className="containerTaskCard">
            <div className="welcomeText hugeText section1">Bun venit, Bildea Cristian!</div>
            <div className="activityText extraLargeText section2">Activitati</div>
            <div className="buttonsActivity section3">
              <OutlinedButton backgroundColor="#1B2430" isRounded="true" labelColor="#fff" label="Afiseaza continutul tabelelor" extraClasses="xsText"/>
              <OutlinedButton backgroundColor="#1B2430" isRounded="true" labelColor="#fff" label="Cauta continut" extraClasses="xsText"/>
              <OutlinedButton backgroundColor="#1B2430" isRounded="true" labelColor="#fff" label="Sterge continut" extraClasses="xsText"/>
              <OutlinedButton backgroundColor="#1B2430" isRounded="true" labelColor="#fff" label="Actualizeaza continut" extraClasses="xsText"/>
              <OutlinedButton backgroundColor="#1B2430" isRounded="true" labelColor="#fff" label="Afiseaza continutul tabelelor" extraClasses="xsText"/>
            </div>
        </div>
    );
}

export default TaskCard;
